import React from 'react';
import './MenuItem.scss';

const MenuItem = ({title}) => (
		<div className='menuItem'>
			<div className='content'>
				<h1 className='title'>{title}</h1>
				<span className='subtitle'>BUY NOW</span>
			</div>
		</div>
	)

export default MenuItem;
